-- DEPARTMENT TABLE INSERT RECORD
CREATE TABLE DEPARTMENT (
	DEPTNO		CHAR(3),
	DEPTNAME	VARCHAR(20)	NOT NULL,
	LOCATION	VARCHAR(20),
	PRIMARY KEY(DEPTNO)
);



-- EMPLOYEE TABLE INSERT RECORD
CREATE TABLE EMPLOYEE (
	EMPNO		CHAR(5),
	EMPNAME	VARCHAR(20)	NOT NULL,
	TITLE		VARCHAR(20),
	SALARY	NUMERIC(20,0),
	DNO		CHAR(10),
	HIREDATE	DATE,
	MANAGER	CHAR(10),
	PRIMARY KEY(EMPNO)
);



-- PROJECT TABLE INSERT RECORD
CREATE TABLE PROJECT (
	PROJNO		CHAR(4),
	PROJNAME	VARCHAR(20)	NOT NULL,
	PMNO		CHAR(10) 	NOT NULL,
	BUDGET		NUMERIC(20,0),
	STARTDATE	DATE		NOT NULL,
	ENDDATE	DATE,
	PRIMARY KEY(PROJNO)
);


-- WORKING TABLE INSERT RECORD 
CREATE TABLE WORKING (
	PNO		CHAR(4)	NOT NULL,
	EMPNO	CHAR(5)	NOT NULL,
	PARTRATE	INTEGER	DEFAULT 100,
	ROLENAME	VARCHAR(20),
	PRIMARY KEY(PNO, EMPNO)
);


CREATE CLASS transit;
CREATE CLASS station;
CREATE CLASS running;
CREATE CLASS bus;
CREATE CLASS line;
CREATE CLASS gate;

ALTER CLASS transit ADD ATTRIBUTE
       trans_id integer NOT NULL,
       station_id integer,
       start_line_id integer,
       arrival_line_id integer,
       information character varying(50);

ALTER CLASS transit ADD ATTRIBUTE
       CONSTRAINT "pk_transit" UNIQUE(trans_id);


ALTER CLASS station ADD ATTRIBUTE
       line_id integer NOT NULL,
       station_id integer NOT NULL,
       station character varying(20);

ALTER CLASS station ADD ATTRIBUTE
       CONSTRAINT "pk_station" UNIQUE(line_id, station_id);


ALTER CLASS running ADD ATTRIBUTE
       run_id integer NOT NULL,
       station_id integer,
       start_station_id integer,
       arrival_station_id integer,
       first_final character(4),
       day_of_week character varying(6),
       start_time character(5);


ALTER CLASS running ADD ATTRIBUTE
       CONSTRAINT "pk_running" UNIQUE(run_id);

ALTER CLASS bus ADD ATTRIBUTE
       bus_id integer NOT NULL,
       station_id integer,
       gate character varying(20),
       bus_num character varying(20);


ALTER CLASS bus ADD ATTRIBUTE
       CONSTRAINT "pk_bus" UNIQUE(bus_id);

ALTER CLASS line ADD ATTRIBUTE
       line_id integer NOT NULL,
       line character(6);


ALTER CLASS line ADD ATTRIBUTE
       CONSTRAINT "pk_line" UNIQUE(line_id);

ALTER CLASS gate ADD ATTRIBUTE
       gate_id integer NOT NULL,
       station_id integer,
       gate character varying(20),
       around_info character varying(50);


ALTER CLASS gate ADD ATTRIBUTE
       CONSTRAINT "pk_gate" UNIQUE(gate_id);









